string[] words = {"n", "v", "u"};
string chars = "nouvk";

var result = 0;
        
for(var i = 0; i < words.Length-1; i++) {
    if(words[i].Length > chars.Length) continue;

    var test = new List<char>(chars.ToCharArray());
    var skip = false;
                
    for(var j = 0; j < words[i].Length; j++) {
        var ix = test.IndexOf(words[i][j]);
        if(ix == -1) {
            skip = true;
            break;
        }
        else
            test.RemoveAt(ix);
    }
    
    if(!skip) result += words[i].Length;
}

return result;

